  [],\n\t\"revision_timestamp\": \"2016-02-26T14:15:41.441856\",\n\t\"name\": \"nist-chem-blast-gateway-for-pdb-srd-155\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Chemical Block Layered Alignment of Substructure
  or Chem-BLAST uses a method for finding chemical compounds within a large collection.
  In this method, all chemical compounds are annotated in terms of standard chemical
  structural fragments. These fragments are then organized into a data tree based
  on their chemical substructures. Search engines have been developed to use this
  data tree. These search engines use the Chem-BLAST technique to search on the fragments
  and look for their chemical structural neighbors. The technique was originally developed
  in the context of the HIV Structural database to enable a query on inhibitors of
  HIV protease. (See http://xpdb.nist.gov/hivsdb/hivsdb.html.) Recently the method
  has been significantly improved to extend to the ligands found in the Protein Data
  Bank (PDB). (See http://xpdb.nist.gov/chemblast/pdb.html.)  The method establishes
  a tree-like relationship between the rings found in three-letter codes that denote
  ligands of the structures found in the PDB. Semantic Web relations are established
  between the structural scaffolds of the ligands and organizes them in an XML database
  utilizing the Web's Resource Description Framework (RDF). An Adobe Flex-based interface
  is used to present this information on the Web. Plans are under way to extend this
  work to non-ring type scaffolds as well. Chem-BLAST has also been extended to structures
  in PubChem. http://xpdb.nist.gov/chemblast/pdb.pl which includes several non-ring
  standard reused groups such as sulfates. Efforts are under way to use the underlying
  principles of Chem-BLAST to enable query on non-structural data, such as cell image
  data http://xpdb.nist.gov/cell/image.pl.\",\n\t\"license_title\": \"Other License
